import React, { Component } from 'react'; 


class Card extends Component {
	constructor (props) {
		super (props); 

		
		this.cardState = this.cardState.bind(this);
	}
	
	render () {
		return (
			<td style ={{backgroundColor: this.state.cardColor, border: 'solid 1px white' }}></td>
		);
	}
}


export default Card;
